import './App.css';
import MyHeader from './MyHeader';
import MyFooter from './MyFooter';

function App() {
  const test = '이게 되네!?'

  const style = {
    bgBlack : {
      backgroundColor : '#000'
    },
    txtWhite : {
      color : '#fff'
    },
    txtGreen : {
      color : 'green'
    }
  }

  return (
    <div style={bgBlack}>
      <MyHeader />
      <h2>React Start! {test}</h2>
      <b id='boldText'>react.js</b>
      <MyFooter/>
    </div>
  );
}

// module.exports = {}
